import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16.018" {...props}><path fill="#787878" d="M1 1h14v14H1z" /><path fill="none" stroke="#fff" strokeMiterlimit={10} d="M4.494 4.459l6.736 6.735M11.5 5.012v6.494H5" /></svg>;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16.018">  <rect x="1" y="1" width="14" height="14" fill="#787878"/>  <line x1="4.494" y1="4.459" x2="11.23" y2="11.194" fill="none" stroke="#fff" stroke-miterlimit="10"/>  <polyline points="11.5 5.012 11.5 11.506 5 11.506" fill="none" stroke="#fff" stroke-miterlimit="10"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
